import axios from 'axios';

const API_URL = 'https://localhost:7215';

const api = axios.create({
  baseURL: API_URL,
  headers: {
    'Content-Type': 'application/json',
  },
});

export const login = async (cpf, senha) => {
  try {
    const response = await api.post('/login', { cpf, senha });
    return response.data;
  } catch (error) {
    throw error;
  }
};

export const register = async (dadosCadastro) => {
  try {
    const response = await api.post('/register', dadosCadastro);
    return response.data;
  } catch (error) {
    throw error;
  }
};

export const cadastrar = register;

